import react from "react";
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      {/* navbar */}
      <nav>
        <img src={logo} className="App-logo" alt="logo" />
      </nav>
      {/* header */}
      <header className="App-header">
        <h1>Hi, Im Aryasena</h1>
        <h2>Welcome to my </h2>
        <a
          className="App-link"
          href="#"
          target="_blank"
          rel="noopener noreferrer"
        >
          Start Exploring!
        </a>
      </header>
    </div>
  );
}

export default App;
